#include <SPI.h>
#include <LoRa.h>

void setup() {
  Serial.begin(9600);
  while (!Serial);

  Serial.println("LoRa Receiver");

  if (!LoRa.begin(915E6)) {
    Serial.println("Starting LoRa failed!");
    while (1);
  }
}

void loop() {
  // Try to parse packet
  int packetSize = LoRa.parsePacket();
  if (packetSize) {
    // Read packet
    String received = "";
    while (LoRa.available()) {
      received += (char)LoRa.read();
    }

    // Print received packet
    Serial.print("Received packet: ");
    Serial.println(received);
  }
}

#include <SPI.h>
#include <LoRa.h>

void setup() {
  Serial.begin(9600);
  while (!Serial);

  Serial.println("LoRa Sender");

  if (!LoRa.begin(915E6)) {
    Serial.println("Starting LoRa failed!");
    while (1);
  }
}

void loop() {
  Serial.print("Sending packet: ");
  Serial.println(counter);

  // Send packet
  LoRa.beginPacket();
  LoRa.print("Hello LoRa ");
  LoRa.print(counter);
  LoRa.endPacket();

  counter++;
  delay(10000);
}
